import React from "react";


const Footer = () => {
    return (
        <div className="footer">
            <div className={"container"}>
                <nav>
                    <ul className="primary-nav">

                        <li ><a href="#">Om</a></li>
                        <li><a href="#">Kontakt</a></li>
                        <li><a href="#">FAQ</a></li>
                        <li><a href="#">Samarbeten</a></li>
                    </ul>

                </nav>
            </div>
        </div>
    )
}
export default Footer;
